  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:06.011994\",\n\t\"name\": \"herbicide-and-algal-population-monitoring-at-desoto-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Herbicide and water quality measurements
  were taken over two years in DeSoto Lake, Marquardt Pond and Young's Ditch on DeSoto
  National Wildlife Refuge. Previous studies had shown the presence of several herbicides
  in the surface waters of the refuge. This study was undertaken to determine if the
  concentrations present were harmful to fish and wildlife resources. Concentrations
  of herbicides detected, except for the drainage ditch, were less than U.S. Environmental
  Protection Agency maximum concentration levels or guidelines. There does not appear
  to be any direct adverse impacts to fish and wildlife resources from these chemicals,
  however, algal productivity may suppressed by the presence of the herbicides.\",\n\t\"license_title\":
